class Solution{
    public:
        bool canPermutePalindrome(const std::string& str){
            if(str.empty()) return true;

            std::vector<int> chars(26, 0);
            int count = 0;
            
            for(int i = 0; i < str.size(); i++){
                chars['z' - str[i]] += 1;
            }

            for(const auto& el : chars){
                if(el % 2 == 1) count++;

                if(count > 1) return false;
            }

            return true;
        }
};
